const Paginado = ({ allGames, paginado, videoJuegosPorPagina }) => {
  const numPage = [];
  for (let i = 0; i < Math.ceil(allGames / videoJuegosPorPagina); i++) {
    numPage.push(i + 1);
  }

  return (
    <nav>
      <div>
        <ul>
          {numPage?.map((num) => (
            <li key={num}>
              <a
                onClick={() => {
                  paginado(num);
                }}
              >
                {num}
              </a>
            </li>
          ))}
        </ul>
      </div>
    </nav>
  );
};

export default Paginado;
